    true,nt"url": null,nt"notes": "Based upon the International Association
    for the Properties of Water and Steam (IAPWS) 1995 formulation for general and scientific
    use for the thermodynamic properties of water, this updated version provides water
    properties from the international standards over a wide range of conditions. Version
    3.0 incorporates new IAPWS standards adopted in 2008 for the viscosity and for the
    melting and sublimation curves and in 2011 for the thermal conductivity.  Source
    code: The FORTRAN subroutines and associated data files are provided for those wishing
    to access NIST-10 calculations from their own applications.  System Requirements:
